    [],nt"revision_timestamp": "2016-07-27T22:57:28.588631",nt"name": "two-ponds-national-wildlife-refuge-annual-narrative-report-fiscal-year-1999",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Two Ponds
    National Wildlife Refuges outlines Refuge accomplishments during the 1999 fiscal
    year.The report begins with an introduction to the Refuge. Highlights and weather
    conditions are summarized for the year. Information about monitoring and studies-
    including surveys, censuses, and studies and investigations- is provided next. Habitat
    restoration and management projects are also covered; activities include upland
    restoration, management of water levels and moist soil units, mowing, prescribed
    burns, and pest control. Fish and wildlife management are discussed next with emphasis
    on bird banding, disease monitoring and treatment, nest structures, and predator
    and exotics control. Coordination activities, such as interagency coordination,
    private land activities, and cooperative organizations are outlined. The resource
    protection section provides an update on law enforcement, wildfire preparedness,
    management of permits and economic uses, contaminant investigation and cleanup,
    management of cultural resources, land acquisition, and threats and conflicts. Information
    about public education and recreation is given including visitor facilities, interpretation,
    wildlife-oriented recreation, environmental education, federal junior duck stamp
    program, and outreach. Finally, comprehensive management planning and general administration
    is discussed in the Refuge planning and administration section.",nt"license_title":
